import React from "react";
import "./TeamPage.css";

const teamMembers = [
  {
    id: 1,
    image: "https://via.placeholder.com/150",
    name: "Akshara",
    college: "KMIT",
    description: "Alice is a front-end developer specializing in React and UX/UI design.",
  },
  {
    id: 2,
    image: "https://via.placeholder.com/150",
    name: "Shraddha",
    college: "KMIT",
    description: "Bob is a back-end developer with a passion for APIs and databases.",
  },
  {
    id: 3,
    image: "https://via.placeholder.com/150",
    name: "Amulya",
    college: "KMIT",
    description: "Charlie is a full-stack developer with experience in MERN stack.",
  },
  {
    id: 4,
    image: "https://via.placeholder.com/150",
    name: "Nischala",
    college: "KMIT",
    description: "Diana is a data scientist focused on machine learning and AI.",
  },
  {
    id: 5,
    image: "https://via.placeholder.com/150",
    name: "Keerthana",
    college: "STU University",
    description: "Eve is a cloud engineer specializing in AWS and DevOps practices.",
  },
  {
    id: 6,
    image: "https://via.placeholder.com/150",
    name: "Sri",
    college: "UVW College",
    description: "Frank is a cybersecurity expert ensuring systems are secure.",
  },
  {
    id: 7,
    image: "https://via.placeholder.com/150",
    name: "Grace Hopper",
    college: "OPQ University",
    description: "Grace is a software engineer with a love for solving complex problems.",
  },
];

const TeamPage = () => {
  return (
    <div className="team-page-wrapper">
      <header>
        <h1>Our Amazing Team</h1>
      </header>
      <div className="team-page">
        <div className="card-container">
          {teamMembers.map((member) => (
            <div key={member.id} className="card">
              <img src={member.image} alt={member.name} />
              <h2>{member.name}</h2>
              <p className="college">{member.college}</p>
              <p className="description">{member.description}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default TeamPage;
